import React, { useState, useEffect } from "react";
import { Info } from "lucide-react";

interface PropertyCardProps {
  title: string;
  subtitle: string;
  description: string;
  images: string[];
  link: string;
}

const PropertyCard: React.FC<PropertyCardProps> = ({
  title,
  subtitle,
  description,
  images,
  link,
}) => {
  const [currentIndex, setCurrentIndex] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) => (prevIndex + 1) % (images.length - 1));
    }, 5000);
    return () => clearInterval(interval);
  }, [images.length]);

  const nextImage = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % (images.length - 1));
  };

  const prevImage = () => {
    setCurrentIndex((prevIndex) => (prevIndex - 1 + (images.length - 1)) % (images.length - 1));
  };

  return (
    <div
      className="property-card"
      style={{
        display: "flex",
        gap: "2rem",
        alignItems: "stretch",
        marginBottom: "3rem",
        maxHeight: "450px",
      }}
    >
      {/* Image principale Ã  gauche */}
      <div style={{ flex: 1 }}>
        <img
          src={images[0] || "https://via.placeholder.com/400x400?text=Image+Principale"}
          alt="Main"
          style={{
            width: "100%",
            aspectRatio: "1 / 1",
            borderRadius: "10px",
            objectFit: "cover",
          }}
        />
      </div>

      {/* Bloc de droite */}
      <div style={{ flex: 1, display: "flex", flexDirection: "column" }}>
        {/* Diaporama */}
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            gap: "1rem",
            position: "relative",
            height: "50%",
          }}
        >
          <button onClick={prevImage} style={arrowStyleLeft}>
            <span style={{ color: "#fff", fontSize: "1rem", fontWeight: "bold" }}>{"<"}</span>
          </button>

          <img
            src={images[currentIndex + 1] || "https://via.placeholder.com/286x286?text=Miniature+1"}
            alt="Mini 1"
            style={miniatureStyle}
          />
          <img
            src={images[(currentIndex + 2) % (images.length - 1) + 1] || "https://via.placeholder.com/286x286?text=Miniature+2"}
            alt="Mini 2"
            style={miniatureStyle}
          />

          <button onClick={nextImage} style={arrowStyleRight}>
            <span style={{ color: "#fff", fontSize: "1rem", fontWeight: "bold" }}>{">"}</span>
          </button>
        </div>

        {/* Texte */}
        <div
          style={{
            textAlign: "center",
            height: "50%",
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
          }}
        >
          <h2 style={{ fontSize: "1.5rem", fontWeight: "bold", color: "#fff" }}>{title}</h2>
          <h3 style={{ fontSize: "1.1rem", color: "#ccc" }}>{subtitle}</h3>
          <p style={{ color: "#eee", margin: "0.5rem 0" }}>{description}</p>
          <a
            href={link}
            style={{
              backgroundColor: "#c59d6b",
              color: "white",
              padding: "0.6rem 1.2rem",
              borderRadius: "30px",
              display: "inline-block",
              textDecoration: "none",
              alignSelf: "center",
            }}
          >
            <Info size={16} style={{ marginRight: "8px" }} /> Descobriu
          </a>
        </div>
      </div>
    </div>
  );
};

const miniatureStyle: React.CSSProperties = {
  width: "288px",
  height: "288px",
  objectFit: "cover",
  borderRadius: "8px",
};

const arrowStyleLeft: React.CSSProperties = {
  position: "absolute",
  left: "-20px",
  top: "50%",
  transform: "translateY(-50%)",
  backgroundColor: "#c59d6b",
  opacity: 0.8,
  borderRadius: "50%",
  padding: "6px",
  border: "none",
  cursor: "pointer",
  zIndex: 2,
};

const arrowStyleRight: React.CSSProperties = {
  position: "absolute",
  right: "-20px",
  top: "50%",
  transform: "translateY(-50%)",
  backgroundColor: "#c59d6b",
  opacity: 0.8,
  borderRadius: "50%",
  padding: "6px",
  border: "none",
  cursor: "pointer",
  zIndex: 2,
};

export default PropertyCard;
